import React from 'react';
import history from '../../history';

import './Game.css';
import GamePanel from './GamePanel/GamePanel';
import GameDrPill from './GameDrPill';

class Game extends React.Component {

    constructor(props) {
        super(props);
        this.game = null;

        this.sec = 60;
    }

    componentDidMount() {
        this.game = new GameDrPill({ 
            id: 'canvas', 
            callbacks: {
                endGame(score) { 
                    /*<form action="/result"></form>;
                    console.log('score', score);
                    let newWin = window.open('/', 'this.results', 'width = 300', 'height = 600');
                    newWin.document.write('this.results');*/
                },
                timeTick: (sec) => {
                    console.log('sec', sec);
                    this.sec = sec;
                    this.changeSec();
                }
            }
        });
    }

    changeSec() {
        return this.sec;
    }

    render() {
        return (
            <div className="Game">
                <GamePanel sec={this.sec} changeSec={this.changeSec} />
                <canvas id='canvas'></canvas>
                <br />
                <form>
                    <button onClick={() => history.push('/')}>Home page</button>
                    <button onClick={() => history.push('/result')}>Results</button>
                </form>
            </div>
        );
    }
}

export default Game;
